css:
atom-text-editor,
:host {
  background-color: #fbfbfb;
  color: #43354b;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: red;
}
atom-text-editor .cursor-line,
:host .cursor-line {
  color: #8abeb7;
}
atom-text-editor .cursor-line.line,
:host .cursor-line.line {
  background-color: #f2f2f2;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #8abeb7;
}
atom-text-editor .gutter,
:host .gutter {
  color: #563444;
}
atom-text-editor .gutter .line-number.cursor-line.cursor-line-no-selection,
:host .gutter .line-number.cursor-line.cursor-line-no-selection {
  color: #8abeb7;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f2f2f2;
  color: #43354b;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f6f6f6;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  border-left-color: #FD3535;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #edece8;
}
atom-text-editor .invisible,
:host .invisible {
  color: #43354b;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #f6f6f6;
  color: red;
}
.editor .selection .region {
  background-color: #eaeaea;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: #ddd;
  border: red;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #333;
}
.comment {
  color: #663d50;
}
.entity.name.type {
  color: #93D0D3;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #81a2be;
}
.keyword {
  color: #93D0D3;
}
.keyword.control {
  color: #f14e00;
  font-weight: bold;
}
.keyword.operator {
  color: red;
}
.keyword.other.special-method {
  color: blue;
}
.keyword.other.unit {
  color: #FF5A0B;
  font-weight: bold;
}
.storage {
  color: red;
}
.constant {
  color: #93D0D3;
}
.constant.character.escape {
  color: red;
}
.variable {
  color: #DE1B1B;
}
.invalid.illegal {
  background-color: red;
  color: #43354b;
}
.string {
  color: #8abeb7;
}
